  return (
    <div  className='bg-blue-200 mt-3'>
      <div>
        <h2 class='text-3xl bg-slate-900'>Why choose us for moving?</h2>
        <p>
          Choose us for your moving needs because we prioritize your peace of
          mind. Our experienced team is dedicated to ensuring a seamless and
          stress-free relocation process.
        </p>
      </div>
      <div>
        <img src="image/Frame (1).svg" alt="" />
        <img src="image/Frame (2).svg" alt="" />
        <img src="image/Frame (3).svg" alt="" />
      </div>
    </div>
  );
}

